import Main from './pages/Main'
export default class Routes extends Component {
  static propTypes = {second: third}

  render() {
    return (
      <Router>
        <Route exact path='/login' component={Login}/>
        <Route exact path='/login' component={Main}/>
      </Router>
    )
  }
}
